oxy_webhelp_navlinks = {"aco_custom_pfiles-d22872e27044":{"topics":[{"title":"Custom PFILE recovery","shortdesc":"<p class=\"shortdesc\">Custom PFILE recovery allows for database Live Mounts or clones that use         configurations other than the original SPFILE configuration.<\/p>","href":"oracle\/custom_spfile_files.html","attributes":{"data-id":"custom_spfile_files"},"menu":{"hasChildren":false},"tocID":"custom_spfile_files-d22872e27055","topics":[]},{"title":"SPFILE requirements","shortdesc":"<p class=\"shortdesc\">The Rubrik cluster uses the original SPFILE of the source database for recovery         during clone and Live Mount operations unless an alternate custom PFILE is         specified.<\/p>","href":"oracle\/spfile_requirements.html","attributes":{"data-id":"spfile_requirements"},"menu":{"hasChildren":false},"tocID":"spfile_requirements-d22872e27066","topics":[]}]}};